import React, { useRef, useState } from "react";


interface IProps{
    questions:string,
    sendUserData:(string:any)=>void;
}
interface IState{}

let Users:React.FC<IProps> =({questions,sendUserData}) =>{

    let [pQuestions , setPQuestions] = useState<string>("");
    // setPQuestions(questions);
    let replyRef:any = useRef();
    let postReply =(event: any)=>{
        event.preventDefault();
        sendUserData(replyRef.current.value);
        replyRef.current.value = "";
    }

    return(
        <>
           <div className="grid">
            <div className="container">
                <div className="row">
                    <div className="col">
                    <div className="card">
                        <div className="card-header">
                            <h3>Admin Questions</h3>
                            {questions}
                        </div>
                        <div className="card-body">
                            <h3>Users Replay</h3>
                            <form name="replay">
                            <input type="text" ref={replyRef} name="replyData" required/>
                            <button onClick={postReply} className="btn btn-success mt-4 text-center align-content-center">Replay Questions</button>
                            {/* {
                                questions && <Users questions={questions}/>
                            } */}
                            </form>
                        </div>
                    </div>
                    </div>
                </div>
            </div>
          </div>

        </>
    );

}

export default Users;
